import React from "react";
import FlipCard from "./FlipCard";

function App() {
  return (
    <div className="App">
      <FlipCard
        element="Hydrogen"
        atomicNumber="1"
        molecularStructure="H2"
        properties="Lightest element, highly flammable"
      />

      <FlipCard
        element="Oxygen"
        atomicNumber="8"
        molecularStructure="O2"
        properties="Vital for respiration, supports combustion"
      />
    </div>
  );
}

export default App;
